import React from 'react';
import { Link, Outlet } from 'react-router-dom';

function Ads() {
  return (
    <div>
      <h1>Ads Page</h1>
      <nav>
        <ul>
          <li><Link to="search">to remove</Link></li>
          <li><Link to="seekingAHome">Seeking a home</Link></li>
          <li><Link to="newAd">New Ad</Link></li>
        </ul>
      </nav>
      <Outlet />  // This component will render the matched sub-rout
    </div>
  );
}

export default Ads;
